import Header from '../components/Header'
import { Outlet, useLocation } from 'react-router-dom'

const Layout = () => {
    const location = useLocation()
    return (
        <main>
            <Header page={'Reporting'} />
            <Outlet />
        </main>
    )
}

export default Layout
